import React from 'react';
import Huge from '../components/Huge';
import Carousel from '../components/Carousel';
function HomeSection(props) {
	return( 
		<div id = "home" className="homelayout  text-warning" style={{backgroundImage: `url("../images/cover.jpeg")` }}>
			<Huge title={props.title} subTitle={props.subTitle} text = {props.text}/>
			<Carousel />
		</div>
	);
}

export default HomeSection;
